import Bike from "./bike";
function Car() {
  let [color, setstate] = useState("");
  return (
    <>
      <h1>I Am {color} FarrariCar</h1>
      <button onClick={() => setstate("Yellow")}>Change color</button>
      <Bike/>
    </>
  );
}
export default Car;
